  {id: 32, key: 32, country: "Япония", image: "", info: "Информация о команде"},
]

const startCommand = {id: 1, key: 1, country: "Австралия", image: "/australia_team.jpg", info: "Информация о команде"}

function App() {
  let [command, setCommand] = useState(startCommand)

  useEffect(() => {
      const row = localStorage.getItem('command')
      setCommand(JSON.parse(row))
  }, [])

  useEffect(() => {
      localStorage.getItem('command', JSON.stringify(command))
  }, [command])

  const changeCommand = (num) => {
    setCommand(command[num])
  }


  return (
    <div className="App">
      <Header className="Header"/>

      <Router>
      <Routes>
        <Route path='/' element={<MainPage/>}/>
        <Route path='/tournier-table' element={<TurnierTable/>}/>
        <Route path='/stadiums' element={<Stadiums/>}/>
        <Route path='/commands' element={<Commands command={command} changeCommand={changeCommand}/>}/>
        <Route path='/predictions' element={<Predictions/>}/>
        <Route path='/login' element={<Login/>}/>
      </Routes>
      </Router>
    </div>
  );
}

export default App;
